"use strict";(self.webpackChunkapi_dokumentasjon=self.webpackChunkapi_dokumentasjon||[]).push([[3897],{9654:e=>{e.exports=JSON.parse('{"label":"news","permalink":"/api-dokumentasjon/tags/news","allTagsPath":"/api-dokumentasjon/tags","count":54,"items":[{"id":"maintenance/feed/2022-08-23-oppdatering-inntekt","title":" Inntekt API og Inntektsmottakere API oppdateres tirsdag 23. august","description":"Inntekt API (tidl. Inntektsmottaker API) og Inntektsmottakere API (gjelder kun OTP) vil snart bli tilgjengelige med Open API spesifikasjon. I den forbindelse har vi ogs\xe5 gjort forbedring i koden for \xe5 effektivisere forvaltning av tjenestene.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-23-oppdatering-inntekt"},{"id":"maintenance/feed/2022-02-18-12-00-endring-xml","title":"Endring av XML for Spesifisert summert skattegrunnlag API ved overgang til OpenAPI spesifikasjon","description":"Som tidligere varslet s\xe5 jobber Skatteetaten med \xe5 migrere alle tjenester til Open API spesifikasjon, og m\xe5let er \xe5 ha alle tjenestene over p\xe5 Open API spesifikasjonen f\xf8r sommeren 2022.","permalink":"/api-dokumentasjon/maintenance/feed/2022-02-18-12-00-endring-xml"},{"id":"maintenance/feed/2022-05-23-15-20-problemer-l\xf8st","title":"Feil i tildeling av nye tilganger er n\xe5 rettet","description":"Det er avdekket en feil i v\xe5re systemer i forbindelse med tildeling av nye tilganger. Feilen kan ha ber\xf8rt enkelte nye konsumenter. Feilen er n\xe5 rettet og vi beklager eventuelle problemer dette har medf\xf8rt.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-23-15-20-problemer-l\xf8st"},{"id":"maintenance/feed/2022-03-16-14-20-feil-inntektsmottaker","title":"Feil p\xe5 Inntektsmottaker API","description":"Det er avdekket en feil hos Skatteetaten som har for\xe5rsaket at enkelte felter har manglet i Inntektsmottaker API. Dette har f\xf8rt til at konsumentene ikke har f\xe5tt alle inntektene de skal ha ved oppslag mot tjenesten. Feilen oppstod 02.mars kl 0950.","permalink":"/api-dokumentasjon/maintenance/feed/2022-03-16-14-20-feil-inntektsmottaker"},{"id":"maintenance/feed/2022-01-13-13-30-forenklet-forvaltning","title":"Forenklet forvaltning av redirect-url\'er for SBL","description":"Skatteetaten, Altinn og BITS har en tid jobbet for \xe5 forenkle forvaltning av redirect-url\'er for SBL-tjenestene, og f\xf8lgende endring ble gjort gjeldene fra 12. januar:","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-13-13-30-forenklet-forvaltning"},{"id":"maintenance/feed/2022-06-09-15-25-ustabilitet","title":"Fortsatt ustabilitet i v\xe5re tjenester","description":"Det er fortsatt ustabilitet i v\xe5re tjenester og vi jobber med feilretting.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-09-15-25-ustabilitet"},{"id":"maintenance/feed/2022-06-10-ustabilitet","title":"Fortsatt ustabilitet i v\xe5re tjenester","description":"Det er fortsatt ustabilitet i v\xe5re tjenester og vi jobber med feilretting. Vi har iverksatt en midlertidig l\xf8sning.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-10-ustabilitet"},{"id":"maintenance/feed/2022-07-18-15-30-ustabilitet-prod","title":"Fortsatt ustabilitet i v\xe5re tjenester","description":"Det er fortsatt litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et. Om feilmelding oppleves, pr\xf8v igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-07-18-15-30-ustabilitet-prod"},{"id":"maintenance/feed/2022-08-30-11-55-ustabilitet-prod","title":"Fortsatt ustabilitet i v\xe5re tjenester","description":"Det er fortsatt litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et. Om feilmelding oppleves, pr\xf8v igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-30-11-55-ustabilitet-prod"},{"id":"maintenance/feed/2022-04-08-20-00-Hasteendring i kveld","title":"Hasteendring i kveld","description":"Det kan bli nedetid p\xe5 tjenester fra Skatteetaten som deler opplysninger fra utkast og fastsatt skattemelding i kommende helg som f\xf8lge av en hasteendring.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-08-20-00-Hasteendring i kveld"},{"id":"maintenance/feed/2022-01-19-14-30-inntektsmottaker-api-oppdatert","title":"Inntektsmottaker API er oppdatert i produksjon","description":"Inntektsmottaker API er oppdatert i produksjon, og st\xf8tter n\xe5 nye l\xf8nnsbeskrivelser som gjelder fra januar 2022.","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-19-14-30-inntektsmottaker-api-oppdatert"},{"id":"maintenance/feed/2022-04-07-10-15-l\xf8st-ustabilitet-prod","title":"L\xf8st - Ustabilitet i v\xe5re tjenester","description":"Problemet er l\xf8st og tjenestene er tilgjengelige igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-07-10-15-l\xf8st-ustabilitet-prod"},{"id":"maintenance/feed/2022-07-08-l\xf8st-Driftsproblemer","title":"L\xf8st-Problemer med betalingsl\xf8sning for omregistreringsavgift","description":"Problem med betalingsl\xf8sning er l\xf8st.","permalink":"/api-dokumentasjon/maintenance/feed/2022-07-08-l\xf8st-Driftsproblemer"},{"id":"maintenance/feed/2022-04-19-14-50-nedetid","title":"Nedetid i Produksjon for Skatteetatens delingstjenester 21. april","description":"Det kan bli nedetid fra Skatteetaten torsdag 21. april mellom kl. 8 og 16 som f\xf8lge av en hasteendring i produksjon.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-19-14-50-nedetid"},{"id":"maintenance/feed/2022-04-29-14-00-planlagt-nedetid","title":"Nedetid i testmilj\xf8 (api-at) l\xf8rdag 7.mai kl.08.00-17.00","description":"Skatteetaten gjennomf\xf8rer en n\xf8dvendig oppgradering i det gamle testmilj\xf8et (api-at) l\xf8rdag 7 mai fra kl.0800. I forbindelse med oppgraderingen vil det bli nedetid p\xe5 tjenestene v\xe5re. Vi minner om at alle s\xe5 fort som mulig g\xe5r over til det nye testmilj\xf8et (api-test).","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-29-14-00-planlagt-nedetid"},{"id":"maintenance/feed/2022-04-19-09-30-planlagt-nedetid","title":"Nedetid p\xe5 tjenester 23.04 og fra 28.04 til 02.05","description":"Skatteetaten skal oppgradere noen systemer l\xf8rdag 23.04, og fra torsdag 28.04 kl. 1600. Som f\xf8lge av dette vil noen av v\xe5re delingstjenester v\xe6re ustabile og tidvis utilgjengelige i denne perioden. F\xf8lgende delingstjenester vil bli ber\xf8rt: Restanser API (v1 og v2) og Oppgaveinnlevering API.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-19-09-30-planlagt-nedetid"},{"id":"maintenance/feed/index","title":"Nyheter og driftsvarsler","description":"","permalink":"/api-dokumentasjon/tag_news"},{"id":"maintenance/feed/2022-06-29-11-25-ustabilitet","title":"Oppdatering ustabilitet i v\xe5re tjenester","description":"Det er fortsatt problemer med oppslag mot v\xe5re tjenester. Det er pga problemer hos AltInn. Dette rammer blant annet Maskinporten, DigDir, BankId m.fl. Maskinporten er utilgjengelig for scopes som bruker AltInn som delegeringskilde.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-29-11-25-ustabilitet"},{"id":"maintenance/feed/2022-05-06-11-10-oppdaterte-vilk\xe5r","title":"Oppdaterte delings- og bruksvilk\xe5r for Skatteetatens delingstjenester","description":"Oppdaterte delings- og bruksvilk\xe5r vil snarlig bli publisert p\xe5 skatteetaten.no. Nye Generelle vilk\xe5r for deling (delingsvilk\xe5r) vil bli publisert p\xe5 https//www.skatteetaten.no/deling/tilgang/delingstjenester/bruksvilkar-for-delingstjenester/.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-06-11-10-oppdaterte-vilk\xe5r"},{"id":"maintenance/feed/2022-01-14-10-30-overgang-open-api","title":"Overgang til Open API spesifikasjon p\xe5 delingstjenester fra Skatteetaten","description":"Bakgrunn","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-14-10-30-overgang-open-api"},{"id":"maintenance/feed/2022-04-25-11-40-problemer-l\xf8st","title":"Problemer l\xf8st","description":"Alle v\xe5re tjenester fungerer n\xe5 som normalt igjen. Vi beklager problemene.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-25-11-40-problemer-l\xf8st"},{"id":"maintenance/feed/2022-05-13-08-50-problemer-l\xf8st","title":"Problemer l\xf8st","description":"Alle v\xe5re tjenester fungerer n\xe5 som normalt igjen. Problemet ble l\xf8st ca 08:05. Vi beklager ulempene nedetiden har medf\xf8rt.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-13-08-50-problemer-l\xf8st"},{"id":"maintenance/feed/2022-05-24-14-40-problemer-l\xf8st","title":"Problemer l\xf8st","description":"Alle v\xe5re tjenester fungerer n\xe5 som normalt igjen. Vi beklager problemene.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-24-14-40-problemer-l\xf8st"},{"id":"maintenance/feed/2022-09-01-08-20-problemer-l\xf8st","title":"Problemer l\xf8st","description":"Alle v\xe5re tjenester fungerer n\xe5 som normalt igjen. Vi beklager problemene.","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-01-08-20-problemer-l\xf8st"},{"id":"maintenance/feed/2022-04-25-11-20-problemer","title":"Problemer med alle tjenester","description":"Det er for \xf8yeblikket problemer med alle v\xe5re tjenester i produksjonsmilj\xf8et. Vi jobber med \xe5 l\xf8se problemet og kommer tilbake med mer informasjon.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-25-11-20-problemer"},{"id":"maintenance/feed/2022-05-13-07-55-problemer","title":"Problemer med alle tjenester","description":"Det er for \xf8yeblikket problemer med alle v\xe5re tjenester i produksjonsmilj\xf8et. Problemene oppstod i natt. Vi jobber med \xe5 l\xf8se problemet og kommer tilbake med mer informasjon.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-13-07-55-problemer"},{"id":"maintenance/feed/2022-07-08-Driftsproblemer","title":"Problemer med betalingsl\xf8sning for omregistreringsavgift","description":"Det er problemer i betalingsl\xf8sningen for omregistreringsavgift. Det jobbes med saken.","permalink":"/api-dokumentasjon/maintenance/feed/2022-07-08-Driftsproblemer"},{"id":"maintenance/feed/2022-01-11-13-35-problemer-med-tjenestene","title":"Problemer med noen av v\xe5re tjenester","description":"Det har v\xe6rt problemer med noen av v\xe5re tjenester i dag. Det ble l\xf8st kl.12:10. Vi beklager problemene.","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-11-13-35-problemer-med-tjenestene"},{"id":"maintenance/feed/2022-02-04-13-05-problemer-med-tjenestene","title":"Problemer med noen av v\xe5re tjenester","description":"Det har v\xe6rt problemer med noen av v\xe5re tjenester i dag fra kl.12:15. Dette gjelder Inntektsmotaker api og Bsu.","permalink":"/api-dokumentasjon/maintenance/feed/2022-02-04-13-05-problemer-med-tjenestene"},{"id":"maintenance/feed/2022-05-24-09-10-problemer-med-tjenestene","title":"Problemer med noen av v\xe5re tjenester","description":"Det har v\xe6rt ustabilitet med noen av v\xe5re tjenester i dag fra kl.08:10.","permalink":"/api-dokumentasjon/maintenance/feed/2022-05-24-09-10-problemer-med-tjenestene"},{"id":"maintenance/feed/2022-04-01-11-00-problemer-test","title":"Problemer med testmilj\xf8 l\xf8st","description":"Vi har i dag hatt problemer med det nye testmilj\xf8et med URL https://api-test.sits.no. Dette gjorde at foresp\xf8rsler mot dette milj\xf8et feilet. Feilen ble l\xf8st ca klokken 11.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-01-11-00-problemer-test"},{"id":"maintenance/feed/2022-02-03-08-10-problemer","title":"Problemer med tjenestene - l\xf8st","description":"Vi har hatt problemer med flere av v\xe5re tjenester i natt og dag tidlig. Feilen ble l\xf8st ca klokken 07:30 og tjenestene skal n\xe5 fungere som normalt.","permalink":"/api-dokumentasjon/maintenance/feed/2022-02-03-08-10-problemer"},{"id":"maintenance/feed/2022-02-04-13-50-problemer-med-tjenestene","title":"Problemer med tjenester - l\xf8st","description":"Det har v\xe6rt problemer med noen av v\xe5re tjenester i dag. Det ble l\xf8st ca.kl.13:26 og tjenestene skal n\xe5 fungere som normalt.","permalink":"/api-dokumentasjon/maintenance/feed/2022-02-04-13-50-problemer-med-tjenestene"},{"id":"maintenance/feed/2022-06-09-10-40-problemer","title":"Problemer med v\xe5re tjenester","description":"Det er for \xf8yeblikket problemer med v\xe5re tjenester i produksjonsmilj\xf8et. Det kan f\xf8re til ustabilitet i systemene v\xe5re.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-09-10-40-problemer"},{"id":"maintenance/feed/2022-03-31-15-30-detaljert-endring","title":"Spesifisering av endring av XML for Spesifisert summert skattegrunnlag API ved overgang til OpenAPI spesifikasjon","description":"Tidligere har vi varslet endring av XML for Spesifisert summert skattegrunnlag API ved overgang til OpenAPI spesifikasjon.","permalink":"/api-dokumentasjon/maintenance/feed/2022-03-31-15-30-detaljert-endring"},{"id":"maintenance/feed/2022-02-11-12-50-ekstern-test","title":"St\xf8tte for nytt inntekts\xe5r i test for skatteoppgj\xf8rstjenestene","description":"Skatteoppgj\xf8rstjenestene er n\xe5 klare for ekstern test for inntekts\xe5r 2021. Det gjelder f\xf8lgene tjenester:","permalink":"/api-dokumentasjon/maintenance/feed/2022-02-11-12-50-ekstern-test"},{"id":"maintenance/feed/2022-01-17-10-30-testdata-inntektsmottaker","title":"Testdata for 2022 for Inntektsmottaker API","description":"Skatteetaten st\xf8tter n\xe5 test av Inntektsmottaker API for 2022 i nytt testmilj\xf8. Eksempler p\xe5 testdata ligger under, inkl. testdata for nye l\xf8nnsbeskrivelser, men vi oppfordrer til \xe5 benytte Tenor testdatas\xf8k for \xe5 finne testdata.","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-17-10-30-testdata-inntektsmottaker"},{"id":"maintenance/feed/2022-01-11-15-45-testdata-ny-\xe5rsversjon","title":"Testdata for nye \xe5rsversjoner i nytt testmilj\xf8","description":"Vi minner om at Skatteetaten har byttet testmilj\xf8 for virksomheter som tester Skatteetatens delingstjenester.","permalink":"/api-dokumentasjon/maintenance/feed/2022-01-11-15-45-testdata-ny-\xe5rsversjon"},{"id":"maintenance/feed/2022-09-06-12-55-ustabilitet-prod-l\xf8st","title":"Ustabilitene i v\xe5re tjenester er l\xf8st","description":"Ustabilitetene i produksjonsmilj\xf8et er l\xf8st.","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-06-12-55-ustabilitet-prod-l\xf8st"},{"id":"maintenance/feed/2022-09-14-10-15-Ustabilitet-test","title":"Ustabilitet i testmilj\xf8","description":"P\xe5 grunn av problemer hos DigDir, kan dette medf\xf8re til problemer med tilgang til v\xe5rt testmilj\xf8. DigDir jobber med \xe5 l\xf8se problemet","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-14-10-15-Ustabilitet-test"},{"id":"maintenance/feed/2022-04-07-10-00-ustabilitet-prod","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden problem med delingstjenestene. Det jobbes med saken.","permalink":"/api-dokumentasjon/maintenance/feed/2022-04-07-10-00-ustabilitet-prod"},{"id":"maintenance/feed/2022-06-29-09-15-ustabilitet","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden ustabilitet i oppslag mot v\xe5re tjenester. Det jobbes med \xe5 l\xf8se problemet.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-29-09-15-ustabilitet"},{"id":"maintenance/feed/2022-07-15-14-00-ustabilitet-prod","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et. Om feilmelding oppleves, pr\xf8v igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-07-15-14-00-ustabilitet-prod"},{"id":"maintenance/feed/2022-08-29-12-45-ustabilitet-prod","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et. Om feilmelding oppleves, pr\xf8v igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-29-12-45-ustabilitet-prod"},{"id":"maintenance/feed/2022-09-01-07-30-ustabilitet-prod","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et. Om feilmelding oppleves, pr\xf8v igjen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-01-07-30-ustabilitet-prod"},{"id":"maintenance/feed/2022-09-06-11-40-ustabilitet-prod","title":"Ustabilitet i v\xe5re tjenester","description":"Det er for tiden litt ustabiliteter i v\xe5re tjenester i produksjonsmilj\xf8et.","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-06-11-40-ustabilitet-prod"},{"id":"maintenance/feed/2022-06-30-09-15-l\xf8st-ustabilitet","title":"Ustabiliteten i v\xe5re tjenester er l\xf8st","description":"Den siste tids problemer med v\xe5re tjenester skal n\xe5 v\xe6re l\xf8st.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-30-09-15-l\xf8st-ustabilitet"},{"id":"maintenance/feed/2022-08-03-13-55-L\xf8st-ustabilitet","title":"Ustabiliteten i v\xe5re tjenester er l\xf8st","description":"Den siste tids problemer med v\xe5re tjenester skal n\xe5 v\xe6re l\xf8st.Vi beklager eventuelle problemer dette har medf\xf8rt for v\xe5re partnere.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-03-13-55-L\xf8st-ustabilitet"},{"id":"maintenance/feed/2022-08-12-12-30-varsel-om-vedlikehold","title":"Varsel om vedlikehold 16. august 2022","description":"Flere av API\'ene vil oppleve sporadisk nedetid mellom kl 1800 tirsdag 16. august, grunnet databaseendringer.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-12-12-30-varsel-om-vedlikehold"},{"id":"maintenance/feed/2022-09-08-13-37-vedlikehold","title":"Varsel om vedlikehold 22.09.2022 og 25.09.2022","description":"I vedlikeholdsvinduet torsdag 22. september fra klokka 18:00 utf\xf8res oppgraderinger som vil f\xf8re til nedetid i skatteetatens tjenester i korte perioder.","permalink":"/api-dokumentasjon/maintenance/feed/2022-09-08-13-37-vedlikehold"},{"id":"maintenance/feed/2022-08-25-vedlikehold","title":"Varsel om vedlikehold 25.08.2022","description":"Det kan bli ustabilitet mellom kl. 2130 pga en endring Skatteetaten m\xe5 gj\xf8re.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-25-vedlikehold"},{"id":"maintenance/feed/2022-08-28-vedlikehold","title":"Varsel om vedlikehold 28.08.2022","description":"Skatteetaten oppgraderer databaser i produksjonsmilj\xf8ene. Arbeidet starter s\xf8ndag 28. august klokka 08:00 og kan komme til \xe5 vare store deler av dagen.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-28-vedlikehold"},{"id":"maintenance/feed/2022-08-28-vedlikehold-utsatt","title":"Vedlikehold 28.08.2022 blir utsatt","description":"Tidligere varslet vedlikehold 28. august 2022 blir utsatt. Vi kommer tilbake med mer informasjon n\xe5r ny dato er klar.","permalink":"/api-dokumentasjon/maintenance/feed/2022-08-28-vedlikehold-utsatt"},{"id":"maintenance/feed/2022-06-22-oppdatert-xml","title":"XML for Spesifisert summert skattegrunnlag API er oppdatert","description":"Tidligere har vi varslet endring av XML for Spesifisert summert skattegrunnlag API ved overgang til OpenAPI spesifikasjon, og denne endringen er i Produksjon fra i dag 22. juni 2022.","permalink":"/api-dokumentasjon/maintenance/feed/2022-06-22-oppdatert-xml"}]}')}}]);